import React from "react";
import {Tile} from "../../components/tile/Tile";

export const TileList = (props) => {

  return (
    <div>
    
    {props.contact.map((name,description)=>{
    
    <Tile name={name} description={description}/>


    })



    }
    </div>
  );
};
